import React from 'react';
import { Link } from 'react-router-dom';

function MemberRow(props) {
    const member = {props}
    return (
        <tr>
            <td> <Link to={'/members/1'}>{props.member.id}</Link></td>
            <td> <Link to={'/members/${props.member.id}'}>{props.member.firstName}</Link></td>
            <td>{props.member.lastName}</td>
            <td>{props.member.nickName}</td>
            <td>{props.member.dateOfBirth}</td>
            <td>{props.member.gender}</td>
            <td>{props.member.married}</td>
        </tr>
    )
}

export default MemberRow;
